ADMIN REVEAL:

Join memestress and hyper-niche internet microcelebrity Miss Lady Salad (Shawn Escarciga) @missladysalad for ADMIN REVEAL, a celebration of internet culture and the artists and thinkers who keep it alive. Miss Lady Salad sits down with a special group of meme makers, content creators, and digital darlings to chat about the philosophy and inspiration behind their online personas, while giving space to share their live performance and artistic practices. ADMIN REVEAL is a hybrid evening of IRL conversation and performance with some of the internet's trashiest, classiest, and most inspired URL accounts.

FRIDAY, JAN. 27:
@namegener8r
@kamikazejones_ x @wussymag
@underscore_unofficial 
@fungusboy x @artandlaborpod

SATURDAY, JAN. 28:
@writerlymemes
@lisaspliffson
@thefenserf

Super excited to share the stage with such a talented group- I’ll be presenting the first ever live viewing of one of my Hypnot!t Therapy clips (big hint in the pics) as well as other goodies. Hit the link in the bio and get tickets while you can!

It’s our month Babyyyyy- Happy Pride from your fav hot, depressed pansexual🌈 Beyond excited to announce that I’ll get to celebrate Pride by hanging out with the hottest queer str!ppers and performers at @thirst.night June 29th. The list incredible performers includes but is not limited to:
@marshobrecker 
@hyperbolethequeen 
@sunnyisasicko 
@samuelpaulish 
@cherry.jaymes 
@tweetexclusively 
@ajathekween 

I am beyond honored to host an event with ppl that radiate so much beauty, talent and power. Queerness is a spectrum and I am so proud and excited to celebrate the limitless of the self with such amazing performers- hit the link in the bio to get your tickets before they sell out 💋
